&lt;td&gt;Параллельный двунаправленный порт Centronics совместимый с IEEE&lt;br&gt;Последовательный портl RS 232C, от 1.200 до 230.400 бод/8 бит&lt;br&gt;Периферийное соединение&lt;br&gt;Порт USB для клавиатуры и сканера&lt;br&gt;Сенсор, фиксирующий окончание этикетки и ленты&lt;br&gt;Предупреждающий конец этикетки&lt;br&gt;Световой индикатор&lt;br&gt;Цифровой интерфейс ввода-вывода&lt;/td&gt;
&lt;/tr&gt;
