&lt;p&gt;&nbsp;&lt;br&gt;&nbsp;&lt;br&gt;&nbsp;&lt;br&gt;&lt;br&gt;&lt;br&gt;&lt;br&gt;&lt;br&gt;&lt;br&gt;&lt;br&gt;&lt;/p&gt;&lt;div style=&quot;clear:both;&quot;&gt;&lt;/div&gt;

Преимущества:
&lt;ul&gt;
&lt;li&gt;Процесс распечатки и наклеивания этикеток выверен во времени, так что ни один элемент не простаивает в очереди&lt;/li&gt;
&lt;li&gt;Процедура распечатки и наклеивания этикеток может производиться одновременно&lt;/li&gt;
&lt;li&gt;Великолепное качество печати и расклейки, чему в немалой степени способствуют расходные материалы, используемые компанией Brady&lt;/li&gt;
&lt;li&gt;Размеры этикеток варьируются от 3.18 мм до 60 мм по высоте, и от 5 мм до 115 мм ширине&lt;/li&gt;
&lt;li&gt;Наличие интерфейса для устройства, считывающего штрих-коды (в случае ошибки в штрих-коде, будет затребована его повторная распечатка)&lt;/li&gt;
&lt;li&gt;Бракованные этикетки могут быть немедленно перепечатаны (до 3-х раз) и затем наклеены. Таким образом экономятся и время, и деньги.&lt;/li&gt;
&lt;li&gt;Ручной или автоматический режим. В первом случае используется ножной выключатель, а во втором рабочий цикл контролируется программируемым логическим контроллером 1-осные установка и вращение ( 90° или 180°) стандартного аппликатора&lt;/li&gt;
&lt;li&gt;Многопозиционность (когда конвейер адаптирован)&lt;/li&gt;
&lt;/ul&gt;&lt;div style=&quot;clear:both;&quot;&gt;&lt;/div&gt;

