&lt;p&gt;&lt;strong&gt;Высокая прочность и долговечность:&lt;/strong&gt;&lt;/p&gt;
&lt;ul style=&quot;list-style-type: square;&quot;&gt;
&lt;li&gt;&lt;span style=&quot;line-height: 1.3em;&quot;&gt;Проверенная в ходе испытаний на удар сверхпрочная конструкция с резиновыми амортизаторами обеспечивает оптимальную защиту от падений&lt;/span&gt;&lt;/li&gt;
&lt;li&gt;&lt;span style=&quot;line-height: 1.3em;&quot;&gt;Эргономичная конструкция, идеальная балансировка и рельефная ручка обеспечивают удобство работы&lt;/span&gt;&lt;/li&gt;
&lt;li&gt;&lt;span style=&quot;line-height: 1.3em;&quot;&gt;Литий-ионная аккумуляторная батарея имеет длительный срок службы&lt;/span&gt;&lt;/li&gt;
&lt;li&gt;&lt;span style=&quot;line-height: 1.3em;&quot;&gt;Принтер оборудован ножом и держателем этикеток, который удерживает этикетки после отрезания и предотвращает их падение&lt;/span&gt;&lt;/li&gt;
&lt;li&gt;&lt;span style=&quot;line-height: 1.3em;&quot;&gt;Накладка с мощным магнитом и ремень позволяют оставить руки свободными&lt;/span&gt;&lt;/li&gt;
&lt;/ul&gt;
&lt;p&gt;&lt;strong&gt;Простота использования:&lt;/strong&gt;&lt;/p&gt;
&lt;ul style=&quot;list-style-type: square;&quot;&gt;
&lt;li&gt;&lt;span style=&quot;line-height: 1.3em;&quot;&gt;Двухстрочный ЖК-дисплей обеспечивает чёткость изображения&lt;/span&gt;&lt;/li&gt;
&lt;li&gt;&lt;span style=&quot;line-height: 1.3em;&quot;&gt;АВС клавиатура, библиотека графических знаков, горячие клавиши&lt;/span&gt;&lt;/li&gt;
&lt;li&gt;&lt;span style=&quot;line-height: 1.3em;&quot;&gt;Интеллектуальная технология распознавания материалов&lt;/span&gt;&lt;/li&gt;
&lt;/ul&gt;
&lt;p&gt;&lt;strong&gt;Высокое качество и долговечность материалов:&lt;/strong&gt;&lt;/p&gt;
&lt;ul style=&quot;list-style-type: square;&quot;&gt;
&lt;li&gt;&lt;span style=&quot;line-height: 1.3em;&quot;&gt;Печать этикеток шириной от 6 до 19 мм&lt;/span&gt;&lt;/li&gt;
&lt;li&gt;&lt;span style=&quot;line-height: 1.3em;&quot;&gt;Возможность регулирования длинны этикетки за счет непрерывных материалов&lt;/span&gt;&lt;/li&gt;
&lt;li&gt;&lt;span style=&quot;line-height: 1.3em;&quot;&gt;Использование 7 различных специализированных материалов, под различные задачи клиента&lt;/span&gt;&lt;/li&gt;
&lt;/ul&gt;

