Web-описание:
&lt;p style=&quot;text-align: justify;&quot;&gt;Ламинатор BRADY позволяет делать качественные пластиковые таблички всего за пару минут. Он представляет собой раскладной стол с валиками для приклеивания пластиковой пластины к этикетке.&lt;/p&gt;
&lt;p style=&quot;text-align: justify;&quot;&gt;Для создания таблички с помощью ламинатора BRADY вам нужно всего три составляющих: сам ламинатор, пластиковые заготовки и напечатанная этикетка размером с заготовку. Никакого электричества и лишних сложностей: один раз покупаете ламинатор и делаете сколько угодно нужных вам табличек.&lt;/p&gt;
&lt;p style=&quot;text-align: justify;&quot;&gt;Пластиковые заготовки поставляются разных размеров, точные данные отображены ниже в таблице. В комплект ламинатора входит разметочный стол для обрезки заготовок до требуемого размера.&lt;/p&gt;

