Web-описание:
&lt;p style=&quot;text-align: justify;&quot;&gt;Механический инструмент для опрессовки трубчатых кабельных наконечников и соединителей по стандарту DIN 46235 / DIN 46267 (часть 1) в диапазоне 6-120 кв.мм&lt;/p&gt;
&lt;p&gt;&lt;strong&gt;Особенности&lt;/strong&gt;&lt;/p&gt;
&lt;ul&gt;
&lt;li&gt;Профиль опрессовки «шестигранник»&lt;/li&gt;
&lt;li&gt;Раздвижные телескопические рукоятки с несколькими фиксируемыми положениями&lt;/li&gt;
&lt;li&gt;Установочное колесико и ячейки на матрицах имеют обозначение размера сечения наконечника&lt;/li&gt;
&lt;li&gt;Синхронная установка обеих вращающихся матриц в нужное положение одним движением&lt;/li&gt;
&lt;li&gt;Эргономичное исполнение, двухкомпонентные рукоятки&lt;/li&gt;
&lt;li&gt;Увеличена жесткость рукояток&lt;/li&gt;
&lt;li&gt;Конструкция инструмента позволяет выполнять опрессовку с меньшим усилием&lt;/li&gt;
&lt;li&gt;Встроенные поворотные матрицы могут быть заказаны отдельно&lt;/li&gt;
&lt;li&gt;Модификация K06DSP с храповым механизмом&lt;/li&gt;
&lt;/ul&gt;
&lt;p&gt;Поставляется в новом исполнении «SYNCRO» с 01.04.2019г.&lt;/p&gt;

&lt;p&gt;Ручной секторный кабелерез для медных и алюминиевых кабелей диаметром по оболочке до 62 мм&lt;/p&gt;
&lt;ul&gt;
&lt;li&gt;Для кабелей заземления, кабелей в резиновой и ПВХ-изоляции&lt;/li&gt;
&lt;/ul&gt;
&lt;p&gt;&lt;strong&gt;Характеристики&lt;/strong&gt;&lt;/p&gt;
&lt;ul&gt;
&lt;li&gt;Работа одной рукой&lt;/li&gt;
&lt;li&gt;Применение высококачественной стали обеспечивает хорошую режущую способность и долгий срок службы&lt;/li&gt;
&lt;li&gt;Оптимальная величина ручного усилия обеспечивается двухходовым зубчатым механизмом&lt;/li&gt;
&lt;li&gt;Не подходит для резки стальных канатов, стальной проволоки и кабелей, армированных или бронированных сталью&lt;/li&gt;
&lt;/ul&gt;
&lt;p&gt;&lt;strong&gt;Техническая информация&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;Диапазон резки: макс. 62 мм (например, 4 x 120 кв.мм NYY)&lt;br /&gt;Длина: 260 мм&lt;br /&gt;Масса: 0,6 кг&lt;/p&gt;

