&lt;ul&gt;
	&lt;li&gt;Две операции с одним инструментом – снятие оболочки круглого кабеля типа NYM диаметром до 8 мм и ПВХ-изоляции внутренних жил кабеля NYM сечением до 6 мм&lt;sup&gt;2&lt;/sup&gt;;&lt;/li&gt;
&lt;/ul&gt;
&lt;ul&gt;
	&lt;li&gt;Снятие ПВХ-изоляции круглых проводов с сечением жилы &nbsp;от 0,5 до 16 мм&lt;sup&gt;2&lt;/sup&gt; &nbsp;для гибких проводов и от 0,5 до 10 мм&lt;sup&gt;2&lt;/sup&gt; для жестких проводов;&lt;/li&gt;
&lt;/ul&gt;
&lt;ul&gt;
	&lt;li&gt;Пятипозиционный переключатель настройки обеспечивает оптимальную адаптацию инструмента для проводов с разным сечением жил в указанном диапазоне;&lt;/li&gt;
&lt;/ul&gt;
&lt;ul&gt;
	&lt;li&gt;Встроенный резак для резки проводов диаметром до 3 мм;&lt;/li&gt;
 &lt;br&gt;
	&lt;li&gt;Ножи стриппера могут быть заменены на новые (арт.wcn51100006).&lt;/li&gt;
	&lt;ul&gt;
		&lt;div style=&quot;clear:both;&quot;&gt;
		&lt;/div&gt;
	&lt;/ul&gt;
&lt;/ul&gt;

Web-описание:
&lt;p&gt;&lt;img src=&quot;images/electro/content-images/7r1.jpg&quot; style=&quot;float: left;&quot; /&gt; &lt;img src=&quot;images/electro/content-images/7r2.jpg&quot; width=&quot;265&quot; height=&quot;210&quot; style=&quot;float: left;&quot; /&gt;&lt;/p&gt;
&lt;p style=&quot;clear: both;&quot;&gt; &lt;/p&gt;
&lt;p style=&quot;clear: both;&quot;&gt;Артикул - &lt;strong&gt;51000007.&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;&lt;strong&gt;Инструмент клещевого типа для снятия ПВХ-изоляции NYM кабеля&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;Корпус имеет такую же конструкцию как у инструмента WEICON № 7-F. V-образный профиль верхнего и нижнего ножей позволяет снимать как мягкую утолщенную оболочку круглого кабеля типа NYM, так и ПВХ-изоляцию внутренних жил кабеля NYM, а также круглых монтажных проводов общего назначения.&lt;/p&gt;

Технические характеристики:
&lt;ul&gt;
&lt;li&gt;Снятие внешней ПВХ-оболочки кабеля и ПВХ-изоляции внутренних жил&lt;/li&gt;
&lt;li&gt;Может использоваться для работы с коаксиальным кабелем&lt;/li&gt;
&lt;li&gt;Два узла - для продольного и поперечного надрезания оболочки кабеля&lt;/li&gt;
&lt;li&gt;Удобен для работы в местах с затрудненным доступом - в разветвительных коробках, в распределительных шкафах и т.д.&lt;/li&gt;
&lt;li&gt;Оптимальные параметры для применения : снятие внешней оболочки кабеля диаметром 4-13 мм, коаксиального кабеля диаметром 4-8 мм, изоляции жил сечением 0,5-16 кв.мм&lt;/li&gt;
&lt;/ul&gt;&lt;div style=&quot;clear:both;&quot;&gt;&lt;/div&gt;

&lt;ul&gt;
&lt;li&gt;Стриппер автоматически адаптируется для снятия изоляции проводов с любым сечением жилы в диапазоне 0,5-6 &nbsp;мм&lt;sup&gt;2&lt;/sup&gt;&lt;/li&gt;
&lt;li&gt;Встроенная шкала измерения длины снимаемой изоляции от 8 до 20 мм&lt;/li&gt;
&lt;li&gt;Встроенный резак для гибких проводов с сечением жилы до 6 мм&lt;sup&gt;2&lt;/sup&gt; ( со сплошными жилами - до 4 мм&lt;sup&gt;2&lt;/sup&gt;)&lt;/li&gt;
&lt;li&gt;Встроенные лезвия для снятия ПВХ-изоляции проводов&nbsp; можно заменить на новые (арт. 51953020)&lt;/li&gt;
&lt;/ul&gt;&lt;div style=&quot;clear:both;&quot;&gt;&lt;/div&gt;

&lt;p&gt;&lt;strong&gt;Снятие оболочки кабеля:&lt;/strong&gt;&lt;/p&gt;
&lt;ul&gt;
&lt;li&gt;Для снятия ПВХ-оболочки всех кабелей круглого сечения диаметром в диапазоне 4-28мм&lt;/li&gt;
&lt;li&gt;Бесступенчатая регулировка глубины реза материала оболочки&lt;/li&gt;
&lt;li&gt;Прижимная скоба переставляется с помощью фиксирующего винта либо в положение, соответствующее диапазону диаметров кабеля 4-16 мм, либо в положение, соответствующее диапазону 16-28 мм&lt;/li&gt;
&lt;li&gt;Внутреннее поворотное лезвие может быть заменено на новое ( арт. wcn51100008)&lt;/li&gt;
&lt;/ul&gt;
&lt;p&gt;&lt;strong&gt;Снятие изоляции провода:&lt;/strong&gt;&lt;/p&gt;
&lt;ul&gt;
&lt;li&gt;Легкое снятие изоляции с проводов с сечением жилы 0,5–6,0 мм&lt;sup&gt;2&lt;/sup&gt;.&lt;/li&gt;
&lt;li&gt;Встроенная шкала измерения длины снимаемой изоляции&lt;/li&gt;
&lt;li&gt;Автоматическая адаптация для снятия изоляции проводов с любым сечением жилы из указанного диапазона&lt;/li&gt;
&lt;li&gt;Встроенные лезвия для снятия ПВХ-изоляции проводов&nbsp; можно заменить на новые (арт. 51953020)&lt;/li&gt;
&lt;/ul&gt;&lt;div style=&quot;clear:both;&quot;&gt;&lt;/div&gt;

&lt;p&gt;&lt;strong&gt;Резка провода:&lt;/strong&gt;&lt;/p&gt;
&lt;ul&gt;
&lt;li&gt;Удобно расположенный встроенный резак для гибких проводов с сечением жилы до 6 мм&lt;sup&gt;2&lt;/sup&gt; (со сплошными жилами - до 4,0 мм&lt;sup&gt;2&lt;/sup&gt;)&lt;/li&gt;
&lt;/ul&gt;
&lt;p&gt;&lt;strong&gt;Снятие изоляции провода:&lt;/strong&gt;&lt;/p&gt;
&lt;ul&gt;
&lt;li&gt;Легкое снятие изоляции с проводов с сечением жилы 0,5–6,0 мм&lt;sup&gt;2&lt;/sup&gt;. Конструкция инструмента обеспечивает автоматическую адаптацию для снятия изоляции проводов с любым сечением жилы из указанного диапазона&lt;/li&gt;
&lt;li&gt;Длина снимаемой изоляции от&nbsp; 5 мм (изоляция сдвигается и остается на жиле)&lt;/li&gt;
&lt;li&gt;Встроенные лезвия для снятия ПВХ-изоляции проводов&nbsp; можно заменить на новые (арт. 51953020)&lt;/li&gt;
&lt;/ul&gt;
&lt;p&gt;&lt;strong&gt;Обжим втулочных наконечников:&lt;/strong&gt;&lt;/p&gt;
&lt;ul&gt;
&lt;li&gt;Два узла для обжима наконечников в диапазонах сечений 0,5-2,5 и 4,0-6,0 мм&lt;sup&gt;2&lt;/sup&gt;&lt;/li&gt;
&lt;/ul&gt;&lt;div style=&quot;clear:both;&quot;&gt;&lt;/div&gt;

Web-описание:
&lt;p&gt;Артикул - &lt;strong&gt;wcn51000300&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;Резка, снятие изоляции провода и обжим втулочных наконечников одним инструментом&lt;/p&gt;
&lt;p&gt;&lt;em&gt; &lt;/em&gt;&lt;/p&gt;

Технические характеристики:
&lt;p&gt;&lt;strong&gt;Резка провода:&lt;/strong&gt;&lt;/p&gt;
&lt;ul&gt;
&lt;li&gt;Для гибких проводов с сечением жилы до 6 мм&lt;sup&gt;2&lt;/sup&gt; (со сплошными жилами - до 4 мм&lt;sup&gt;2&lt;/sup&gt;). Безопасность использования инструмента обеспечивается ограничителем расхода режущих кромок&lt;/li&gt;
&lt;/ul&gt;
&lt;p&gt;&lt;strong&gt;Снятие изоляции провода:&lt;/strong&gt;&lt;/p&gt;
&lt;ul&gt;
&lt;li&gt;Для гибких проводов и проводов со сплошными жилами сечением 0,5/0,75/1,5/2,5/4,0/6,0 мм&lt;sup&gt;2&lt;/sup&gt;&lt;/li&gt;
&lt;/ul&gt;
&lt;p&gt;&lt;strong&gt;Снятие оболочки кабеля:&lt;/strong&gt;&lt;/p&gt;
&lt;ul&gt;
&lt;li&gt;Для круглых кабелей диаметром 8-11 мм (например, для NYM – от 3х1,5 до 5х2,5 мм&lt;sup&gt;2&lt;/sup&gt;)&lt;/li&gt;
&lt;li&gt;Два узла для надрезания оболочки – поперечной и продольной. Удобен для работы в местах с затрудненным доступом - в разветвленных коробках, в распределительных шкафах и т.п.&lt;/li&gt;
&lt;/ul&gt;&lt;div style=&quot;clear:both;&quot;&gt;&lt;/div&gt;

