&lt;p&gt;Артикул &lt;strong&gt;wcn51000400&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;Универсальный инструмент для снятия ПВХ-оболочки кабелей и ПВХ-изоляции проводов&lt;/p&gt;

Технические характеристики:
&lt;ul&gt;
&lt;li&gt;Надежный инструмент для снятия оболочки кабеля и срезания отдельных слоев изоляции на кабелях с многослойной изоляцией&lt;/li&gt;
&lt;li&gt;Кончик лезвия имеет специальную плужковую насадку, ограничивающую глубину реза изоляционной оболочки, что исключает повреждение внутренних слоев изоляции и проводов&lt;/li&gt;
&lt;/ul&gt;&lt;div style=&quot;clear:both;&quot;&gt;&lt;/div&gt;

&lt;ul&gt;
&lt;li&gt;Специально разработан для выполнения одним инструментом двух операций: снятие ПВХ-оболочки плоских двух- и трехжильных силовых кабелей и ПВХ-изоляции жил этих кабелей сечением 0,75-4 мм&lt;sup&gt;2&lt;/sup&gt;&lt;/li&gt;
&lt;li&gt;Пятипозиционный переключатель настройки обеспечивает оптимальную адаптацию инструмента на снятие оболочки или изоляции внутренних жил кабелей разного сечения&lt;/li&gt;
&lt;li&gt;Может использоваться для снятия изоляции жил и оболочки круглых кабелей для сечений 0,5-16 мм&lt;sup&gt;2&lt;/sup&gt;. Для снятия оболочки кабеля сечением 10-16 мм&lt;sup&gt;2&lt;/sup&gt; производится предварительный надрез оболочки вращением инструмента по оси на 90&lt;sup&gt;0&lt;/sup&gt;&lt;/li&gt;
&lt;li&gt;Встроенный резак для проводов диаметром до 3 мм&lt;/li&gt;
&lt;li&gt;Ножи стриппера могут быть заменены на новые ( арт.wcn51100007)&lt;/li&gt;
&lt;/ul&gt;&lt;div style=&quot;clear:both;&quot;&gt;&lt;/div&gt;

