&lt;p&gt;Артикул &lt;strong&gt;wcn51001007&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;&lt;strong&gt; &lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;Инструмент для работы с плоским кабелем - стриппер клещевого типа&lt;/p&gt;

Технические характеристики:
&lt;ul&gt;
&lt;li&gt;Может быть использован для снятия оболочки любых коаксиальных кабелей диаметром 4,8 - 7,5 мм (например, телевизионные фидеры, кабели передачи данных)&lt;/li&gt;
&lt;li&gt;Может использоваться также для снятия оболочки круглых гибких кабелей&lt;/li&gt;
&lt;li&gt;Регулировка глубины реза изоляции не предусмотрена&lt;/li&gt;
&lt;/ul&gt;&lt;div style=&quot;clear:both;&quot;&gt;&lt;/div&gt;

&lt;ul&gt;
&lt;li&gt;Снятие оболочки коаксиальных кабелей диаметром 4,8 – 7,5 мм и изоляции их жилы (например, телевизионных фидеров, кабелей передачи данных)&lt;/li&gt;
&lt;li&gt;Может использоваться также для снятия мягкой оболочки круглых кабелей 3х0,75 мм&lt;sup&gt;2&lt;/sup&gt;, 10 и 16 мм&lt;sup&gt;2 &lt;/sup&gt;;&lt;/li&gt;
&lt;li&gt;Эргономичная форма корпуса позволяет работать продолжительное время с высокой интенсивностью&lt;/li&gt;
&lt;li&gt;Встроенный резак для кабеля&lt;/li&gt;
&lt;/ul&gt;&lt;div style=&quot;clear:both;&quot;&gt;&lt;/div&gt;

&lt;ul&gt;
&lt;li&gt;Для круглых кабелей и кабелей с толстой изоляцией (для помещений с высокой влажностью) диаметром 8 - 13 мм (например, NYM от 3х1,5 кв.мм до 5х2,5 кв.мм)&lt;/li&gt;
&lt;li&gt;Удобен для снятия оболочки кабелей в местах с затрудненным доступом - в разветвительных коробках, в распределительных шкафах и т.д.&lt;/li&gt;
&lt;li&gt;Инструмент надежно удерживается в ладони, благодаря эргономичной форме корпуса&lt;/li&gt;
&lt;li&gt;Регулировка глубины реза изоляции не предусмотрена&lt;/li&gt;
&lt;/ul&gt;&lt;div style=&quot;clear:both;&quot;&gt;&lt;/div&gt;

