Преимущества:
&lt;p&gt;Корпус инструмента выполнен из &lt;strong&gt;ударопрочного пластика&lt;/strong&gt;, армированного стекловолокном&lt;/p&gt;
&lt;p&gt;Есть &lt;strong&gt;выдвигаемое лезвие-крюк&lt;/strong&gt;, которое в нерабочем положении скрыто в корпусе инструмента&lt;/p&gt;
&lt;p&gt;Повышенная &lt;strong&gt;безопасность&lt;/strong&gt; в эксплуатации&lt;/p&gt;
&lt;p&gt;Выдвигаемое лезвие может быть &lt;strong&gt;заменено на новое&lt;/strong&gt; (арт. &lt;strong&gt;wcn52953040&lt;/strong&gt;)&lt;/p&gt;&lt;div style=&quot;clear:both;&quot;&gt;&lt;/div&gt;

Web-описание:
&lt;p&gt;Артикул &lt;strong&gt;wcn52000016&lt;/strong&gt;&lt;/p&gt;
&lt;p style=&quot;text-align: justify;&quot;&gt;Универсальный инструмент № 16 QUADRO для снятия ПВХ-оболочки кабелей и ПВХ-изоляции проводов и жил&lt;/p&gt;
&lt;p&gt;Снятие ПВХ-оболочки кабеля:&lt;br /&gt; &gt; Для круглых кабелей диаметром 8-13 мм (например, для NYM – от 3х1,5 до 5х2,5 кв.мм)&lt;br /&gt; &gt; Два узла для надрезания оболочки – для поперечного и продольного реза. Удобен для работы в местах с затрудненным доступом – в разветвительных коробках, в распределительных шкафах и т.д.&lt;/p&gt;
&lt;p&gt;Снятие ПВХ-изоляции проводов и жил:&lt;br /&gt; &gt; Для снятия изоляции гибких проводников и проводов со сплошными жилами сечением 0,5/0,75/1,5/2,5/4,0/6,0 кв.мм&lt;/p&gt;

Технические характеристики:
&lt;ul&gt;
&lt;li&gt;Удаление оболочек круглых кабелей диаметром от &nbsp;Ø 25,0 мм&lt;/li&gt;
&lt;li&gt;Не &nbsp;повреждаются внутренние оболочки и изоляция жил&lt;/li&gt;
&lt;li&gt;Предназначен для круговых и продольных резов облочки&lt;/li&gt;
&lt;li&gt;Регулируемая глубина реза от 0 &nbsp;до&nbsp; 5 мм&lt;/li&gt;
&lt;li&gt;Оболочка может разрезаться как с конца кабеля, так и в середине&lt;/li&gt;
&lt;li&gt;Корпус инструмента выполнен из пластика, армированного &nbsp;стекловолокном&lt;/li&gt;
&lt;li&gt;Пластиковый бокс для хранения инструмента (в комплекте)&lt;/li&gt;
&lt;li&gt;Лезвие сменное, одно лезвие можно использовать с двух сторон&lt;/li&gt;
&lt;li&gt;Лезвие для надрезания оболочки &nbsp;может быть заменено на новое ( арт. wcn52953020)&lt;/li&gt;
&lt;/ul&gt;&lt;div style=&quot;clear:both;&quot;&gt;&lt;/div&gt;

Web-описание:
&lt;p&gt;Артикул &lt;strong&gt;wcn52000025&lt;/strong&gt;&lt;br /&gt;&lt;br /&gt;&lt;/p&gt;
&lt;p&gt;Инструмент для удаления оболочки кабеля &lt;/p&gt;
&lt;p&gt;&lt;strong&gt; &lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;&lt;img src=&quot;images/files/weicon/wcn_t_25_dop.png&quot; alt=&quot;&quot; style=&quot;font-size: 12.16px; line-height: 1.3em;&quot; /&gt;&lt;/p&gt;

Преимущества:
&lt;p&gt;&lt;strong&gt;Резка монтажных проводов&lt;/strong&gt;, контрольных кабелей и кабелей типа ВВГ, NYM, ПВС диаметром по оболочке до 13 мм, одножильных многопроволочных кабелей с сечением жилы до 35 мм&lt;sup&gt;2&lt;/sup&gt;&lt;/p&gt;
&lt;p&gt;&lt;strong&gt;Удаление оболочки&lt;/strong&gt; круглых кабелей&lt;/p&gt;
&lt;p&gt;Лезвия из специальной &lt;strong&gt;нержавеющей стали&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;&lt;strong&gt;Микронасечки&lt;/strong&gt; на режущих кромках предотвращают скольжение провода между лезвиями&lt;/p&gt;
&lt;p&gt;&lt;strong&gt;Двухкомпонентные&lt;/strong&gt; пластиковые рукоятки обеспечивают удобное удержание в руке&lt;/p&gt;
&lt;p&gt;&lt;strong&gt;Ребристые вставки-упоры&lt;/strong&gt; на рукоятках позволяют прижимать ножницы ладонью к поверхности стола для увеличения усилие реза&lt;/p&gt;
&lt;p&gt;&lt;strong&gt;Безлюфтовое&lt;/strong&gt; резьбовое шарнирное соединение&lt;/p&gt;
&lt;p&gt;На внутренней стороне рукояток расположен &lt;strong&gt;узел обжима&lt;/strong&gt;, в котором при необходимости можно обжать втулочные наконечники сечением от 0,5 до 4 мм&lt;sup&gt;2&lt;/sup&gt;&lt;/p&gt;
&lt;p&gt;&lt;strong&gt;Пластиковый чехол&lt;/strong&gt; обеспечивает безопасность хранения ножниц и позволяет подвешивать их на ремень монтажной сумки или на пояс брюк&lt;/p&gt;
&lt;p&gt;Ножницы не предназначены для работы под напряжением!&lt;/p&gt;&lt;div style=&quot;clear:both;&quot;&gt;&lt;/div&gt;

