Преимущества:
&lt;h3&gt;Надежная работа в любых условиях&lt;/h3&gt;
&lt;ul&gt;
	&lt;li&gt;Прошедший испытания на удар принтер этикеток с прорезиненными углами обеспечивает оптимальную защиту от падений, износа и разрыва&lt;/li&gt;
	&lt;li&gt;Эргономичная конструкция и идеальная развесовка с удобной рельефной ручной для простоты в обращении&lt;/li&gt;
	&lt;li&gt;Аккумуляторная батарея повышенной емкости обеспечивает печать без подключения к сети и не требует частой зарядки&lt;/li&gt;
	&lt;li&gt;До 250 этикеток в день для увеличенного объема печати&lt;/li&gt;
&lt;/ul&gt;
&lt;h3&gt;Простота эксплуатации&lt;/h3&gt;
&lt;ul&gt;
	&lt;li&gt;Большой дисплей со светодиодной подсветкой обеспечивает четкость изображения&lt;/li&gt;
	&lt;li&gt;QWERTY, библиотека графических элементов, горячие клавиши и функции меню для быстрого создания этикеток&lt;/li&gt;
	&lt;li&gt;Функции WYSIWYG подразумевают возможность просмотра печатаемой информации — печать требуется выполнить только один раз&lt;/li&gt;
	&lt;li&gt;Магнит для автоматической печати&lt;/li&gt;
&lt;/ul&gt;
&lt;h3&gt;Клавиатура&lt;/h3&gt;
&lt;ul&gt;
	&lt;li&gt;Долговечность разработанного материала&lt;/li&gt;
	&lt;li&gt;Надежная печать полноразмерных идентификационных этикетов шириной 25,4 мм для увеличения объема данных&lt;/li&gt;
	&lt;li&gt;Обеспечьте высокие результаты работы благодаря использованию штампованных материалов, обеспечивающих единообразие и профессиональное качество, или используйте непрерывный материал, если необходимо отрегулировать длину этикетки.&lt;/li&gt;
	&lt;li&gt;Возможность использования до 10 разных долговечных отраслевых материалов, которые отвечают любым требованиям&lt;/li&gt;
&lt;/ul&gt;
&lt;h3&gt;Усовершенствованная универсальная система картриджей&lt;/h3&gt;
&lt;ul&gt;
	&lt;li&gt;Интеллектуальная технология распознавания материалов обеспечивает автоматическую настройку формата этикеток без калибровки&lt;/li&gt;
	&lt;li&gt;Подбор правильной ленты для оптимальной производительности печати&lt;/li&gt;
	&lt;li&gt;Простота хранения, транспортировки и использования нескольких картриджей&lt;/li&gt;
	&lt;li&gt;Быстрая и простая замена расходных материалов, достаточно вставить необходимый картридж&lt;/li&gt;
	&lt;li&gt;При замене расходных материалов картридж можно извлечь одной рукой, потянув за выступ&lt;/li&gt;
&lt;/ul&gt;

