Преимущества:
&lt;h3&gt;Высокая прочность и долговечность:&lt;/h3&gt;
&lt;ul style=&quot;list-style-type: square;&quot;&gt;
	&lt;li&gt;Проверенная в ходе испытаний на удар сверхпрочная конструкция с резиновыми амортизаторами обеспечивает оптимальную защиту от падений&lt;/li&gt;
	&lt;li&gt;Эргономичная конструкция, идеальная балансировка и рельефная ручка обеспечивают удобство работы&lt;/li&gt;
	&lt;li&gt;Литий-ионная аккумуляторная батарея имеет длительный срок службы&lt;/li&gt;
	&lt;li&gt;Принтер оборудован ножом и держателем этикеток, который удерживает этикетки после отрезания и предотвращает их падение&lt;/li&gt;
	&lt;li&gt;Накладка с мощным магнитом и ремень позволяют оставить руки свободными&lt;/li&gt;
&lt;/ul&gt;
&lt;h3&gt;Простота использования:&lt;/h3&gt;
&lt;ul style=&quot;list-style-type: square;&quot;&gt;
	&lt;li&gt;Двухстрочный ЖК-дисплей обеспечивает чёткость изображения&lt;/li&gt;
	&lt;li&gt;АВС клавиатура, библиотека графических знаков, горячие клавиши&lt;/li&gt;
	&lt;li&gt;Интеллектуальная технология распознавания материалов&lt;/li&gt;
&lt;/ul&gt;
&lt;h3&gt;Высокое качество и долговечность материалов:&lt;/h3&gt;
&lt;ul style=&quot;list-style-type: square;&quot;&gt;
	&lt;li&gt;Печать этикеток шириной от 6 до 19 мм&lt;/li&gt;
	&lt;li&gt;Возможность регулирования длинны этикетки за счет непрерывных материалов&lt;/li&gt;
	&lt;li&gt;Использование 7 различных специализированных материалов, под различные задачи клиента&lt;/li&gt;
&lt;/ul&gt;
&lt;h3&gt;Поддержка 2D-кодов (датаматрикс и QR-коды):&lt;/h3&gt;
&lt;ul style=&quot;list-style-type: square;&quot;&gt;
	&lt;li&gt;Для кодировки текста используйте латинские символы&lt;/li&gt;
	&lt;li&gt;Печать 2D-кодов доступна только для этикеток 19,05 мм шириной&lt;/li&gt;
&lt;/ul&gt;
&lt;h3&gt;Лабораторные символы:&lt;/h3&gt;
&lt;ul style=&quot;list-style-type: square;&quot;&gt;
	&lt;li&gt;Более 50 специальных символов для маркировки образцов&lt;/li&gt;
	&lt;li&gt;Используйте со шрифтами от 9 и выше для лучшего отображения&lt;/li&gt;
&lt;/ul&gt;
