Web-описание:
&lt;p style=&quot;text-align: justify;&quot;&gt;Промышленный принтер Brady i7100 предлагает долговечную и высококачественную идентификацию для таких отраслей, как авиация, оборона, общественный транспорт, электроника, логистика и автомобильная промышленность.&lt;/p&gt;
&lt;p style=&quot;text-align: justify;&quot;&gt;Принтер Brady i7100 создает быструю печать на различных типах материалов, применяемых для маркировки кабеля, печатных плат, идентификации имущества/компонентов.&lt;/p&gt;
&lt;p style=&quot;text-align: justify;&quot;&gt;Brady i7100 оснащен интуитивно понятным цветным сенсорным экраном с отличительными иконками, что упрощает работу с меню принтера. Складывающаяся в две стороны крышка из ударопрочного пластика позволяет создать компактную зону хранения принтера и сократить время на смену расходных материалов.&lt;/p&gt;

