	&lt;li&gt;Высокоскоростной порт USB 2.0 для подключения к ПК&lt;/li&gt;
	&lt;li&gt;Ethernet 10/100 Base T, LPD, RAWLIP-печать, DHCP, HTTP, FTP, SMTP, SNMP, NTP RS 422, RS 485, от 1.200 до 230.400 Baud 8/bit (опционально)&lt;/li&gt;
