Web-описание:
&lt;p style=&quot;text-align: justify;&quot;&gt;BBP™72 – это принтер этикеток для двусторонней печати на термоусадочных маркерах шириной 101,60 мм. BBP™72 значительно экономит время, так как одновременно производитпечать с обеих сторон ленты. Этот принтер – идеальное решение для печати маркировки для авиа- и космического строения, военно-оборонной отрасли и машиностроения.&lt;/p&gt;
&lt;p style=&quot;text-align: justify;&quot;&gt;До настоящего времени предприятия, использующие термоусадочные маркеры, были ограничены в возможностях печати – принтер мог печатать только с одной стороны трубки, и, таким образом, противоположные 180 градусов провода с другой стороны оставалось не промаркированным. Или же нужно было вручную перематывать материал, настраивать и печатать снова – с другой стороны маркеров. Данная операция была трудоёмкой, утомительной и дорогостоящей.&lt;/p&gt;
&lt;p style=&quot;text-align: justify;&quot;&gt;Двусторонняя печать на принтере этикеток Brady BBP72 - эффективная альтернатива применению стандартного настольного принтера THT, когда необходима двойн

