Преимущества:
&lt;h3&gt;Простота и скорость работы&lt;/h3&gt;
&lt;ul&gt;
	&lt;li&gt;Быстрая замена материала. Простота установки и извлечения картриджа, который совмещает в себе материал и риббон.&lt;/li&gt;
	&lt;li&gt;Автоматическое форматирование этикеток. Каждый картридж оснащен технологией Smart Cell , которая управляет всеми функциями принтера и автоматически производит калибровку формата этикеток. Для работы достаточно лишь вставить картридж.&lt;/li&gt;
	&lt;li&gt;Быстрая печать.&lt;/li&gt;
	&lt;li&gt;Встроенный нож. Устройство имеет встроенный самоочищающийся нож, который легко разрежет любой материал и придержит отрезанную этикетку, пока Вы её не возьмёте.&lt;/li&gt;
&lt;/ul&gt;
&lt;h3&gt;Простая эксплуатация&lt;/h3&gt;
&lt;ul&gt;
	&lt;li&gt;Беспроводное подключение. Встроенная технология Bluetooth® (Блютуз) и карта Wi-Fi позволят удобно и легко пользоваться принтером.&lt;/li&gt;
	&lt;li&gt;Программа для печати LabelMark™ помимо прочих возможностей позволяет производить печать штрих-кодов, введение даты, времени и рисунков, осуществлять автоматическую сериализацию данных и обеспечивает много других практичных функций.&lt;/li&gt;
	&lt;li&gt;Этикетки в рулонах или в заданных формах. Для обозначения проводников, кабелей, панелей или устройств Вам понадобится всего лишь один принтер. Вы можете выбрать из 20 видов материалов и 130 стандартных размеров.&lt;/li&gt;
	&lt;li&gt;Этикетки шириной до 38,10 мм. Можете изготовить этикетки, которые будут хорошо видны даже на большом расстоянии (или изготовить наклейки длиной до 1 м!).&lt;/li&gt;
	&lt;li&gt;Сильный магнит позволяет крепить принтер на металлические поверхности - дверцу электрощита, лестницу, полку, и т.д. Ваши руки будут оставаться свободными.&lt;/li&gt;
&lt;/ul&gt;
&lt;h3&gt;Подключение принтера с помощью беспроводной технологии&lt;/h3&gt;
&lt;p&gt;
	 Вы можете управлять принтерами BMР™51/BMР™53 с помощью Вашего смартфона на базе Android. Скачав приложение Brady Mobile, которое доступно на Android Market, Вы сможете создавать, редактировать и отправлять на печать этикетки с Вашего смартфона. Соединение с принтером устанавливается через Bluetooth.
&lt;/p&gt;
