Web-описание:
&lt;p style=&quot;text-align: justify;&quot;&gt;Промышленный принтер этикеток Brady i5100 – идеальное сочетание интеллекта и производительности для печати широкого спектра этикеток на различных видах материалов в таких сегментах рынка, как:&lt;/p&gt;
&lt;p style=&quot;padding-left: 30px;&quot;&gt;• Электрика&lt;br /&gt;• СКС/Телеком&lt;br /&gt;• Лаборатории&lt;br /&gt;• Электроника (не серийное производство)&lt;/p&gt;
&lt;p style=&quot;text-align: justify;&quot;&gt;Обладает цветным сенсорным экраном, предельно простым и понятным меню, не требует специальных навыков для использования. Поддерживает распознание материалов и риббонов по встроенному чипу.&lt;/p&gt;

