&lt;ul&gt;
	&lt;li&gt;Если Вы сталкиваетесь с такими проблемами, как заедание бумаги или искажение изображения, попробуйте вставлять по одному листу в устройство подачи бумаги. Всегда выбирайте опцию, которая позволяет обеспечить наиболее прямой тракт прохождения бумаги.&lt;/li&gt;
	&lt;li&gt;Устанавливайте самый светлый тип тонера в настройках Вашего принтера для лучшего качества изображения. Для большинства принтеров&nbsp;&lt;em&gt;Hewlett-Packard Laserjet&lt;/em&gt;&nbsp;и совместимых к ним, это будет цвет тонера №9.&lt;/li&gt;
	&lt;li&gt;Не рекомендуется использование материалов Brady для лазерной печати на принтерах&nbsp;&lt;em&gt;Hewlett-PackardLaserjetIIP, IIIP, Laserjet 4, 4Si, 4V, Laserjet 5L, KyoceraFS-400A&lt;/em&gt;&nbsp;и модели принтеров&nbsp;&lt;em&gt;ColorLaserjet.&lt;/em&gt;&lt;/li&gt;
	&lt;li&gt;Плохое качество изображения может быть связано с тем, что Вы использовали материалы, не совместимые с конкретным принтером. Так же причиной искаженного изображения может стать тонер плохого качества.&lt;/li&gt;
	&lt;li&gt;Перезаправка картриджа не рекомендована производителями принтеров, так как это может повлиять на качество печати.&lt;/li&gt;
&lt;/ul&gt;
