Web-описание:
&lt;p&gt;• Вскрытие пластиковых корпусов устройств, выключателей, крышек отсеков батареек, кабельных каналов и т.д.&lt;/p&gt;
&lt;p&gt;• Бережная работа с чувствительными поверхностями&lt;/p&gt;
&lt;p&gt;• Не повреждает края и не оставляет царапин&lt;/p&gt;
&lt;p&gt;• Гибкая и прочная конструкция из полиамида, армированного стекловолокном&lt;/p&gt;
&lt;p&gt;• Три рычажных участка разной толщины&lt;/p&gt;

&lt;p&gt;• Одновременное снятие оболочки коаксиального кабеля на глубину 10 мм и изоляции центральной жилы на глубину 6 мм – для большинства F-коннекторов (10/6 мм)&lt;/p&gt;
&lt;p&gt;• Встроенные лезвия не требуют регулировки глубины реза&lt;/p&gt;
&lt;p&gt;• Захватывающий зажим позволяет завинчивать F-коннекторы на кабеле&lt;/p&gt;
&lt;p&gt;• Монтаж или демонтаж F-коннекторов выполняется встроенным шестигранником с размером 11 мм (SW 11)&lt;/p&gt;
&lt;p&gt;• Эргономичная форма корпуса&lt;/p&gt;
&lt;p&gt;• Можно устанавливать дополнительно приобретаемые ножевые вставки жёлтого цвета (арт. wcn52100009) для снятия оболочки и изоляции жилы на другую глубину: 13/6,5 мм&lt;/p&gt;

&lt;p&gt;• Не повреждает чувствительные поверхности и не оставляет царапин&lt;/p&gt;
&lt;p&gt;• Гибкая и прочная конструкция из полиамида, армированного стекловолокном&lt;/p&gt;
&lt;p&gt;• Вставка из высококачественной нержавеющей стали&lt;/p&gt;
&lt;p&gt;• Деликатная разборка корпусов приборов и устройств, демонтаж крышек и заглушек, извлечение компонентов и деталей конструкции, открытие защёлок&lt;/p&gt;
&lt;p&gt;• Удаление остатков клея с помощью металлической вставки&lt;/p&gt;

&lt;p&gt;• Подходит для кабелей Cat5, Cat6, Cat7 O 4,5-10 мм)&lt;/p&gt;
&lt;p&gt;• Встроенный регулируемый ограничитель длины снимаемой оболочки в диапазоне 30-100 мм&lt;/p&gt;
&lt;p&gt;• Эргономичная форма корпуса предотвращает скольжение в руке и обеспечивает безопасность применения&lt;/p&gt;

