 &lt;b&gt;&lt;br&gt;
 &lt;/b&gt;&lt;b&gt;Инструмент поставляется в пластиковом боксе с Li-ion аккумулятором 18В/1.3Ач и зарядным устройством LGL1.&lt;/b&gt;
&lt;/div&gt;
 &lt;br&gt;

Преимущества:
&lt;p&gt;Инструмент для опрессовки кабельных наконечников EK 35/4-L оснащен Li-ion аккумулятором производства фирмы Makita. Li-ion аккумуляторы не имеют эффекта «памяти» и саморазряда. Инструменты всегда готовы к применению даже после длительных перерывов в работе. Li-ion аккумуляторы имеют меньший вес, большую емкость и несравнимо меньшее время зарядки, чем аналогичные Ni-Mh аккумуляторы. Сетевой адаптер NG2230 обеспечивает работу инструментов от сети 220 В переменного напряжения и может быть заказан отдельно.&lt;/p&gt;
&lt;p&gt;Автоматический возврат поршня гидравлической системы инструмента в исходное положение при завершении цикла опрессовки – уже хорошо известная осо-бенность инструментов производства компании Klauke.&lt;/p&gt;
&lt;p&gt;Еще одна полезная функция, реализованная в этих инструментах,– мгновенная остановка двигателя инструмента при отпускании оператором кнопки «пуск», - позволяет экономить время, обеспечивает безопасность и удобство при работе с инструментом. При необходимости оператор может прервать рабочий цикл в любой момент, отпустив кнопку «пуск». А нажав кнопку «возврат» на корпусе инструмента, можно вернуть поршень гидравлической системы и матрицы в исходное положение.&lt;/p&gt;
&lt;p&gt;Как и все новые инструменты для опрессовки производства компании Klauke, инструмент EK 35/4-L снабжен системой мониторинга опрессовки Intelligent Pressing System (IPS). IPS сообщает об отклонениях от нормальной работы инструмента красным свечением светодиода на корпусе инструмента и звуковым сигналом, обеспечивая абсолютную безопасность работы с инструментом и гарантируя надежность соединения.&lt;/p&gt;
&lt;p&gt;Встроенный светодиод красного свечения также служит для индикации необходимости проведения технического обслуживания инструмента, состояния аккумулятора, а также применяется для передачи данных о работе инструмента в персональный компьютер через USB адаптер PGA1 (заказывается отдельно).&lt;/p&gt;
&lt;p&gt;&nbsp;&lt;/p&gt;&lt;div style=&quot;clear:both;&quot;&gt;&lt;/div&gt;

