&lt;h3&gt;Результат без усилий&lt;/h3&gt;
&lt;ul&gt;
	&lt;li&gt;Масштабные графические изображения шириной до 254мм&lt;/li&gt;
	&lt;li&gt;Простой интерфейс с сенсорным экраном для автономного использования или печати с ПК с MarkWare™ (русский язык)&lt;/li&gt;
	&lt;li&gt;Приложения для быстрой печати маркировки труб, предупреждающих знаков, информационных знаков и многого другого&lt;/li&gt;
	&lt;li&gt;USB порт для импорта файлов, шрифтов и графических объектов&lt;/li&gt;
&lt;/ul&gt;
&lt;h3&gt;Яркая цветная печать&lt;/h3&gt;
&lt;ul&gt;
	&lt;li&gt;Особо стойкая многоцветная термотрансферная печать&lt;/li&gt;
	&lt;li&gt;Быстрая печать знаков стандартного формата, с использованием заранее отпечатанных шаблонов заголовков&lt;/li&gt;
	&lt;li&gt;Добавьте креативности с MarkWare™(версия 3.9.3 и выше)&lt;/li&gt;
	&lt;li&gt;Порт Еthernet для подключения принтера к сети&lt;/li&gt;
&lt;/ul&gt;
&lt;h3&gt;Превосходные материалы&lt;/h3&gt;
&lt;ul&gt;
	&lt;li&gt;Огромный выбор промышленных материалов для наружного применения шириной от 101, 6 до 254 мм&lt;/li&gt;
	&lt;li&gt;Специальные материалы, включая светоотражающие и фотолюминесцентные&lt;/li&gt;
