Web-описание:
&lt;p style=&quot;text-align: justify;&quot;&gt;Струйный цветной принтер J2000 разработан для визуализации и печати знаков безопасности, GHS/CLP-этикеток, кратких информационных табличек и маркировки в лабораториях.&lt;/p&gt;
&lt;p style=&quot;text-align: justify;&quot;&gt;Легкая и понятная работа принтера поможет донести до сотрудников информацию о безопасности, процедурах, идентификации объектов, сократить число несчастных случаев на производстве и увеличить производительность.&lt;/p&gt;
&lt;p style=&quot;text-align: justify;&quot;&gt;Материалы Brady, используемые для печати, устойчивы к воздействию жидкостей и внутреннего освещения, а технология автоматического распознавания размера материала экономит время на настройку печати.&lt;/p&gt;
&lt;p style=&quot;text-align: justify;&quot;&gt;Максимальный размер материала – 101,6 мм. Это значит, что вы легко и быстро сможете печатать даже большие полноцветные этикетки.&lt;/p&gt;

