Преимущества:
&lt;p&gt;
 &lt;strong&gt;Принтер BBP37 – это новое поколение цветных принтеров GlobalMark для печати и&nbsp;&lt;/strong&gt;&lt;strong&gt;вырубки от компании Brady.&lt;/strong&gt;
&lt;/p&gt;
&lt;p&gt;
	 Благодаря простой автоматической настройке печати, а также интуитивно понятному сенсорному&nbsp;дисплею вы сможете легко и быстро создать и напечатать привлекающие внимание знаки и&nbsp;этикетки непосредственно на объекте!
&lt;/p&gt;
&lt;p&gt;
	 Новый улучшенный пользовательский интерфейс. Принтеры оснащены 7-дюймовым (18 см по диагонали) сенсорным ЖК дисплеем, цифровой клавиатурой и мышкой.
&lt;/p&gt;
&lt;p&gt;
	 • Расширенные варианты подключения: USB-порт, Wi-Fi, Ethernet через сетевую карту Brady (разъем BNC).&lt;br&gt;
	 • Встроенные приложения для печати маркировки трубопроводов, знаков безопасности и&nbsp;многого другого!&lt;br&gt;
	 • Автономная печать готовых символов по регламенту CLP/GHS (регламент по маркировке химических веществ и смесей) и знаков по стандарту ISO7010.&lt;br&gt;
	 • Удобная печать на надпечатанных вырубных этикетках с заголовками&nbsp;по регламенту CLP/GHS, по стандарту ANSI/OSHA и др.&lt;br&gt;
	 • Увеличенная скорость печати до 127 мм в секунду.&lt;br&gt;
	 • Высокая точность резки по контуру.
&lt;/p&gt;
&lt;div style=&quot;clear:both;&quot;&gt;
&lt;/div&gt;
 &lt;br&gt;

