Web-описание:
&lt;p style=&quot;text-align: justify;&quot;&gt;Принтер S3100 для печати широкого спектра разнообразных знаков и этикеток для повышения безопасности и эффективности любого рабочего места. Он предназначен для создания знаков безопасности, напольной маркировки, 5S этикеток, складской маркировки (знаки для идентификации стоек, дверей, лестниц, мусорных корзин, столов и стульев), знаков CLP для идентификации химических веществ.&lt;/p&gt;
&lt;p style=&quot;text-align: justify;&quot;&gt;Создание этикеток стало легче за счет улучшенного интерфейса и новой технологии сенсорного экрана, принтер печатает как автономно, так и с подключением к компьютеру. Интеграция в рабочу сеть возможна с помощью Wi-Fi, принтер совместим с ПО Brady Workstation для создания самых разных этикеток и доступа к новым функциям.&lt;/p&gt;
&lt;p style=&quot;text-align: justify;&quot;&gt;Автоматическая настройка этикеток: всего 20 секунд на смену материала. Чипованные ленты и риббоны распознаются принтером в течение нескольких секунд и автоматически настраиваются для создания этикетки, и нет расхода м

